function countPairs(coordinates: number[][], k: number): number {
    const freqMap = new Map<string, number>();
    let count = 0;

    for (const [x, y] of coordinates) {
        const xorXK = (x ^ k).toString();
        const xorYK = (y ^ k).toString();

        // Increment count based on previous occurrences that satisfy the distance condition
        count += freqMap.get(xorXK + ',' + y) || 0;
        count += freqMap.get(x + ',' + xorYK) || 0;
        count += freqMap.get(xorXK + ',' + xorYK) || 0;

        // Handle case where XOR results in zero, which wasn't counted in the above steps
        if (k === 0) count -= 2 * (freqMap.get(x + ',' + y) || 0);

        // Update frequency map for current point
        freqMap.set(x + ',' + y, (freqMap.get(x + ',' + y) || 0) + 1);
    }

    return count;
};
